import React from 'react'
import './Header.css'
import {search} from '@fortawesome/react-fontawesome'
function Header() {
    return (
      <div>
        <div className="hamIcon">
            <h1 className="icon">&#9776;</h1>
        </div>
        <div className="box">
        <search icon={search}/>
            <input type="text" name="" className="search"></input>
        </div>
      </div>
    );
  }
  
  export default Header;
